const Home = () => {
    const [heros, setHeros] = useState([])
    let heroi = ''

    useEffect(() => {
        fetch('https://www.superheroapi.com/api.php/3992681667526682/search/batman')
        .then(response => response.json())
        .then(data => {
            console.log(data)
            setHeros(data)
            heroi.id = heros
        })
    })


    return(
        <>
        <h1>heros</h1>

        <h3 style={{padding:'50px'}}> nome: {heros} - id: {heroi}</h3>

        </>
    )
}

export default Home
